  <style type="text/css">
	#wrapper {
		padding-top: 50px;
	}

  	#visualisation {
  		border: 1px solid grey;
  		position: relative;
  		width: 100%;
  		height: 255px;
  		margin-bottom: 1em;
  	}
  	#visualisation > div {
  		position: absolute;
  		width: 0.025%;
  		bottom: 0;
  		background: chartreuse;
  	}

    #visualisation-pcm-original-chunk-by-chunk,
  	#visualisation-pcm-lowpass,
    #visualisation-pcm-original {
  		border: 1px solid grey;
  		height:200px;
  		position: relative;
  		width: 100%;
  	}
  	/*
    #visualisation-pcm-lowpass:after,
    #visualisation-pcm-original:after {
  		content: "";
  			position: absolute;
  			top: 50%;
  			width: 100%;
  			height:1px;
  			background: red;
  	} */

    #visualisation-pcm-original-chunk-by-chunk > .chunk-container > div,
  	#visualisation-pcm-lowpass > .chunk-container > div,
    #visualisation-pcm-original > .chunk-container > div{
		  position: absolute;
		  overflow:visible;
  		width: 0.025%;
  		bottom: 0;
  		background: transparent;
  	}

    #visualisation-pcm-original-chunk-by-chunk > .chunk-container > div:after,
  	#visualisation-pcm-lowpass > .chunk-container > div:after,
    #visualisation-pcm-original > .chunk-container > div:after{
		content: "";
		position:absolute;
		height:1px;
		width:1px;
		top:0;
		left:0;
  		background: tomato;
  	}

  </style>
